        "overview": "Suits on the Loose is the story of two rebellios teens Justin (Brandon Beemer) and Tyler (Ty Hodges) – who break out from a state-sponsored correctional facility in the Mojave desert run by General Wilkins (Charles Napier). When their getaway vehicle breaks down at an abandoned rest stop, they steal a car from two naïve Mormon missionaries (Shaun Weiss and Jason Winer) who are on their way to their way to their newest assignment in the sleepy town of New Harmony. Justin and Tyler decide to play the part of missionaries until they figure out the next stage of their getaway. Before they know it they are swept up in the rigors of missionary life by the welcoming townspeople, including Bishop Hollister (Robert Prosky), Regy Steedman (Reginald Veljohnson) and especially Sarah (Allison Lange), a beautiful and charming waitress who captures Justin’s heart with her confidence and bold honesty. With the two real missionaries and General Wilkins closing in fast, how long can their charade last? Besides, up by six o’clock in the morning, no drinking, smoking or dating – in many ways missionary life turns out to be just as hard as their detention program.",
